import React, { Component } from 'react';
import './Stack.css';

class Stack extends Component {
	state = {
		stack: []
	}
	render() {
		return (
			<>
				<p>Stack goes here.</p>
				<button>Enqueue</button>
				<button>Dequeue</button>
			</>
		);
	}
}

export default Stack;
